import React, { useState } from 'react';
import './sidebar.css';

const Sidebar = () => {
  const [collapsed, setCollapsed] = useState(false);

  const toggleSidebar = () => {
    setCollapsed(!collapsed);
  };

  return (
    <div className={`sidebar ${collapsed ? 'collapsed' : ''}`}>
      <div className="sidebar-header">
        <div className="sidebar-toggle" onClick={toggleSidebar}>
          <i className={`fas ${collapsed ? 'fa-bars' : 'fa-times'}`}></i>
        </div>
        {!collapsed && <div className="sidebar-title">YouTube</div>}
      </div>
      {!collapsed && (
        <div className="sidebar-menu">
          <div className="sidebar-menu-item active">
            <i className="fas fa-home"></i>
            <span>Главная</span>
          </div>
          <div className="sidebar-menu-item">
            <i className="fas fa-fire"></i>
            <span>Популярное</span>
          </div>
          <div className="sidebar-menu-item">
            <i className="fas fa-history"></i>
            <span>История</span>
          </div>
          <div className="sidebar-menu-item">
            <i className="fas fa-play-circle"></i>
            <span>Ваши видео</span>
          </div>
          <div className="sidebar-menu-item">
            <i className="fas fa-clock"></i>
            <span>Посмотреть позже</span>
          </div>
          <div className="sidebar-menu-item">
            <i className="fas fa-thumbs-up"></i>
            <span>Понравившиеся видео</span>
          </div>
        </div>
      )}
    </div>
  );
};

export default Sidebar;
